function RecordCard({ record }) {

    return (
        <div className="col">
            <div className="card">
                <div className="card-body">
                    <h5>Artist</h5>
                    <p className="card-text">{record.artist}</p>
                    <h5>Album</h5>
                    <p className="card-text">{record.album}</p>
                    <h5>Year</h5>
                    <p className="card-text">{record.year}</p>
                </div>
            </div>
        </div>
    );
}

export default RecordCard;
